AND "insertTimestamp" >= #{抽出期間開始日時} AND "insertTimestamp" < #{抽出期間終了日時}
AND ("hakoYMD" is null or "hakoYMD"='')
AND ("hakoYMD" is not null or "hakoYMD" <> '')
AND "hihokenshaNo" IN ( SELECT DISTINCT "hihokenshaNo" FROM rgdb."DbT4001JukyushaDaicho" WHERE "insertTimestamp" >= #{抽出期間開始日時} AND "insertTimestamp" <= #{抽出期間終了日時} AND "yukoMukoKubun" = '1' AND "logicalDeletedFlag" = false AND "chokkinIdoJiyuCode" IN ('01', '02', '04', '10') UNION SELECT DISTINCT "hihokenshaNo" FROM rgdb."DbT3017KyufujissekiKihon" WHERE "insertTimestamp" >= #{抽出期間開始日時} AND "insertTimestamp" < #{抽出期間終了日時} )
) AS dbT3113RiyoshaFutanWariai ON dbT3114RiyoshaFutanWariaiMeisai."nendo" = dbT3113RiyoshaFutanWariai."nendo" AND dbT3114RiyoshaFutanWariaiMeisai."hihokenshaNo" = dbT3113RiyoshaFutanWariai."hihokenshaNo" AND dbT3114RiyoshaFutanWariaiMeisai."rirekiNo" = dbT3113RiyoshaFutanWariai."rirekiNo" ORDER BY dbT3114RiyoshaFutanWariaiMeisai."nendo" , dbT3114RiyoshaFutanWariaiMeisai."hihokenshaNo" , dbT3114RiyoshaFutanWariaiMeisai."edaNo"

